toString() & parseInt()
코딩 테스트에서 정수를 특정 진법으로 변환한 후에 어떤 처리를 하고, 다시 정수로 변환하는 문제에서 유용하게 쓸 수 있는 쌍.
const int = 3;
let decimal = int.toString(3); // 정수 => 3진법 문자열 변환
// 어떤 처리
const result = decimal.parseInt(3); // 3진법 문자열 => 정수 변환

pages/typescript/abstractClass.html.body:
abstract class
Typescript를 사용하면 Java와 같은 abstract class 사용 가능.
// 추상 클래스 선언
abstract class SayHello {
  // 추상 메소드 선언
  abstract getName(): string;

  printName() {
    console.log(`Hello, ${this.getName()}`);
  }
}

class Choi extends SayHello {
  getName() {
    return "Choi";
  }
}

const choi = new Choi();
choi.printName();

대부분의 기능을 미리 구현해놓고, 서브 클래스에서 필요한 부분만 오버라이당한다.

