인자 전달방식

기본 타입의 경우:

값이 복사되어 전달.
매개변수가 변경되어도 실인자 값은 변경되지 않음.



public class Test {
    public static void main(String[] args) {
        int n = 10;

        public void increase(int num) {
            num += 1;
        }

        increase(n);
        System.out.println(n); // 10
    }
}


객체 혹은 배열의 경우:
객체, 배열의 레퍼런스 전달.
매개변수와 실인자가 값을 공유함.



메소드 오버로딩

이름이 동일하고 매개변수의 개수나 타입이 다름.
리턴 타입은 관계 없음.

class Method {
  public int sum(int i, int j) {
    return i + j;
  }
  public int sum(int i, int j, int k) {
    return i + j + k;
  }
}

pages/java/static.html.body:
static 키워드

non-static 멤머

공간적: 객체마다 별도 존재.
시간적: 객체 생성 후 사용 가능.
비공유: 객체마다 배타적.


static 맴머

공간적: 클래스 당 하나만 생성.
시간적: 클래스 로딩 시 공간 할당.
공유: 동일 클래스의 모든 객체들이 공유함.



static은 전역 변수, 전역 함수를 만들 때 사용.
class StaticSample {
    public int n;
    public static int m;

    public static void main(String[] args) {
        StaticSample s1 = new StaticSample();
        StaticSample s2 = new StaticSample();

        s1.n = 1;
        s1.m = 1;
        s2.n = 2;
        s2.m = 2;

        System.out.println(s1.n); // 1
        System.out.println(s1.m); // 2
    }
}

